import React from "react";
import { NavLink } from "react-router-dom";
import appRoutes from "../../shared/appRoutes";
import Wrapper from "./NavBar.style.js";
import smallKey from "../../assets/imgs/small-key.svg";
import smallKeyFlipped from "../../assets/imgs/small-key-right.svg";

const NavBar = (pageName) => {
  const pages = ["workrook", "room237", "elevator", "bathroom", "corridor", "snowfield"];
  let nextPage = "";

  for (let i = 0; i < pages.length; i++) {
    if (pages[i] == pageName) {
      nextPage = pages[i + 1];
    }
  }

  return (
    <Wrapper>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="nav-item">
          <NavLink className="nav-link" to={appRoutes.home} exact>
            <img className="key" src={smallKey} />
            &nbsp;&nbsp;&nbsp;&nbsp;
            <span>Go to lobby</span>
          </NavLink>
        </div>
        <div className="nav-item">
          <NavLink className="nav-link" to={appRoutes.workroom}>
            <span>Next room</span>
            &nbsp;&nbsp;&nbsp;&nbsp;
            <img className="key" src={smallKeyFlipped} />
          </NavLink>
        </div>
      </nav>
    </Wrapper>
  );
};

export default NavBar;
